import './Question.css'

import { Accordion, Container } from "react-bootstrap"

function Question(){

    const ArraysOfQuestion = [{
        id: 1,
        question: 'Lorem ipsum dolor',
        answer: 'Lorem ipsum dolor'
    },
    {
        id: 2,
        question: 'Lorem ipsum dolor',
        answer: 'Lorem ipsum dolor'
    },
    {
        id: 3,
        question: 'Lorem ipsum dolor',
        answer: 'Lorem ipsum dolor'
    },
    {
        id: 4,
        question: 'Lorem ipsum dolor',
        answer: 'Lorem ipsum dolor'
    }]
    const ArraysOfQuestionOnMap = ArraysOfQuestion.map((ArrayOfQuestion) =>
    <Accordion key = {ArrayOfQuestion.id} className = "question">
        <Accordion.Item>
            <Accordion.Header>{ArrayOfQuestion.question}</Accordion.Header>
                    
            <Accordion.Body>
                {ArrayOfQuestion.answer}
            </Accordion.Body>
        </Accordion.Item>
    </Accordion>
    )

    return(
        <Container>
            <div className="text-center">
                <h1>Вопросы?</h1>
            </div>

            {ArraysOfQuestionOnMap}
        </Container>
    )
}

export default Question
